using System;
using System.Linq;
using Shouldly;
using System.Threading.Tasks;
using Volo.Abp.Domain.Repositories;
using Xunit;

namespace Resume.ResumeSkills
{
    public class ResumeSkillsAppServiceTests : ResumeApplicationTestBase
    {
        private readonly IResumeSkillsAppService _resumeSkillsAppService;
        private readonly IRepository<ResumeSkill, Guid> _resumeSkillRepository;

        public ResumeSkillsAppServiceTests()
        {
            _resumeSkillsAppService = GetRequiredService<IResumeSkillsAppService>();
            _resumeSkillRepository = GetRequiredService<IRepository<ResumeSkill, Guid>>();
        }

        [Fact]
        public async Task GetListAsync()
        {
            // Act
            var result = await _resumeSkillsAppService.GetListAsync(new GetResumeSkillsInput());

            // Assert
            result.TotalCount.ShouldBe(2);
            result.Items.Count.ShouldBe(2);
            result.Items.Any(x => x.Id == Guid.Parse("d060aa61-4624-4a5f-8b19-b574649e2982")).ShouldBe(true);
            result.Items.Any(x => x.Id == Guid.Parse("8f39a22d-3c53-4602-98b3-031906f3f466")).ShouldBe(true);
        }

        [Fact]
        public async Task GetAsync()
        {
            // Act
            var result = await _resumeSkillsAppService.GetAsync(Guid.Parse("d060aa61-4624-4a5f-8b19-b574649e2982"));

            // Assert
            result.ShouldNotBeNull();
            result.Id.ShouldBe(Guid.Parse("d060aa61-4624-4a5f-8b19-b574649e2982"));
        }

        [Fact]
        public async Task CreateAsync()
        {
            // Arrange
            var input = new ResumeSkillCreateDto
            {
                ResumeMainId = Guid.Parse("507cba14-00cf-43e2-846b-3459c7472a37"),
                ComputerExpertise = "",
                ComputerExpertiseEtc = "",
                ChineseTypingSpeed = 1554124388,
                ChineseTypingCode = "f21ded54924f49b690110b94bffd9e7df713bc9312ae4fcdab",
                EnglishTypingSpeed = 932954376,
                ProfessionalLicense = "",
                ProfessionalLicenseEtc = "",
                WorkSkills = "",
                WorkSkillsEtc = "",
                ExtendedInformation = "",
                DateA = new DateTime(2015, 10, 1),
                DateD = new DateTime(2013, 4, 21),
                Sort = 2078177606,
                Note = "",
                Status = "14be6cbe717540e5b41e3cecd55919bc656f2ae7bc70466dba"
            };

            // Act
            var serviceResult = await _resumeSkillsAppService.CreateAsync(input);

            // Assert
            var result = await _resumeSkillRepository.FindAsync(c => c.Id == serviceResult.Id);

            result.ShouldNotBe(null);
            result.ResumeMainId.ShouldBe(Guid.Parse("507cba14-00cf-43e2-846b-3459c7472a37"));
            result.ComputerExpertise.ShouldBe("");
            result.ComputerExpertiseEtc.ShouldBe("");
            result.ChineseTypingSpeed.ShouldBe(1554124388);
            result.ChineseTypingCode.ShouldBe("f21ded54924f49b690110b94bffd9e7df713bc9312ae4fcdab");
            result.EnglishTypingSpeed.ShouldBe(932954376);
            result.ProfessionalLicense.ShouldBe("");
            result.ProfessionalLicenseEtc.ShouldBe("");
            result.WorkSkills.ShouldBe("");
            result.WorkSkillsEtc.ShouldBe("");
            result.ExtendedInformation.ShouldBe("");
            result.DateA.ShouldBe(new DateTime(2015, 10, 1));
            result.DateD.ShouldBe(new DateTime(2013, 4, 21));
            result.Sort.ShouldBe(2078177606);
            result.Note.ShouldBe("");
            result.Status.ShouldBe("14be6cbe717540e5b41e3cecd55919bc656f2ae7bc70466dba");
        }

        [Fact]
        public async Task UpdateAsync()
        {
            // Arrange
            var input = new ResumeSkillUpdateDto()
            {
                ResumeMainId = Guid.Parse("3963640a-0e7a-495e-8a7f-0455ac5e952d"),
                ComputerExpertise = "",
                ComputerExpertiseEtc = "",
                ChineseTypingSpeed = 1687066731,
                ChineseTypingCode = "3881916421314394a9f98a6642d412b9e8e1225f3f0c4f74ae",
                EnglishTypingSpeed = 1946132503,
                ProfessionalLicense = "",
                ProfessionalLicenseEtc = "",
                WorkSkills = "",
                WorkSkillsEtc = "",
                ExtendedInformation = "",
                DateA = new DateTime(2006, 8, 13),
                DateD = new DateTime(2019, 1, 8),
                Sort = 611251898,
                Note = "",
                Status = "ddf3b8b6ec3d40d58a8aa509878d7d92c9f085feae034eb680"
            };

            // Act
            var serviceResult = await _resumeSkillsAppService.UpdateAsync(Guid.Parse("d060aa61-4624-4a5f-8b19-b574649e2982"), input);

            // Assert
            var result = await _resumeSkillRepository.FindAsync(c => c.Id == serviceResult.Id);

            result.ShouldNotBe(null);
            result.ResumeMainId.ShouldBe(Guid.Parse("3963640a-0e7a-495e-8a7f-0455ac5e952d"));
            result.ComputerExpertise.ShouldBe("");
            result.ComputerExpertiseEtc.ShouldBe("");
            result.ChineseTypingSpeed.ShouldBe(1687066731);
            result.ChineseTypingCode.ShouldBe("3881916421314394a9f98a6642d412b9e8e1225f3f0c4f74ae");
            result.EnglishTypingSpeed.ShouldBe(1946132503);
            result.ProfessionalLicense.ShouldBe("");
            result.ProfessionalLicenseEtc.ShouldBe("");
            result.WorkSkills.ShouldBe("");
            result.WorkSkillsEtc.ShouldBe("");
            result.ExtendedInformation.ShouldBe("");
            result.DateA.ShouldBe(new DateTime(2006, 8, 13));
            result.DateD.ShouldBe(new DateTime(2019, 1, 8));
            result.Sort.ShouldBe(611251898);
            result.Note.ShouldBe("");
            result.Status.ShouldBe("ddf3b8b6ec3d40d58a8aa509878d7d92c9f085feae034eb680");
        }

        [Fact]
        public async Task DeleteAsync()
        {
            // Act
            await _resumeSkillsAppService.DeleteAsync(Guid.Parse("d060aa61-4624-4a5f-8b19-b574649e2982"));

            // Assert
            var result = await _resumeSkillRepository.FindAsync(c => c.Id == Guid.Parse("d060aa61-4624-4a5f-8b19-b574649e2982"));

            result.ShouldBeNull();
        }
    }
}